import React from 'react';
import logo from './logo.svg';
import './App.css';
import Cards from "../src/Component/Cards";
import SData from "./Component/SData";

function App() {

  return (
    <div>

     <h1>Welcome to top 5 netflix series</h1>

     <Card
      imgsrc={SData.imgsrc}
      title={SData.title}
      sname={SData.sname}
      link={SData.link}/>
  </div>);
};
export default App;
